import "./App.css";
import Navbar from "./components/Navbar";
import "./components/Navbar.css";
import Book from "./components/Book";

function App() {
  return (
    <div>
      <Navbar title="Something" />
      <Book
        Booktitle="Respected Black Man"
        author="Neslson Mandela"
        price="Cheap as Cotton"
      />
    </div>
  );
}

export default App;
